const apiKey = 'dIJrma20pSU6ymMwWnDbiaT7NFHeAGVa';
const apiUrl = ``

export default function getGifs() {
    fetch(apiUrl)
      .then(res => res.json())
      .then(response => {
        const {data = []} = response;
        const gifs = data.map(image => image.images.downsized_medium.url);
        return gifs;
      })
}
